(1, 'Perdagangan Elektronik', 0, 'Perdagangan elektronik adalah penyebaran, pembelian, penjualan, pemasaran barang dan jasa melalui sistem elektronik seperti internet, televisi, dan jaringan komputer lainnya', 'published', 1, 'Botble\\ACL\\Models\\User', NULL, 0, 0, 1, '2023-01-07 20:27:30', '2023-01-15 03:35:05'),
(2, 'Gaya', 0, 'Fashion dapat diartikan sebagai gaya berbusana yang populer dan diadaptasi oleh suatu budaya. Mulai dari gaya berpakaian seseorang dalam keseharian ataupun ketika menghadiri acara tertentu', 'published', 1, 'Botble\\ACL\\Models\\User', NULL, 0, 1, 0, '2023-01-07 20:27:30', '2023-01-15 03:38:19'),
(3, 'Elektronik', 0, 'Elektronik adalah alat yang dibuat berdasarkan prinsip elektronika serta hal atau benda yang menggunakan alat tersebut', 'published', 1, 'Botble\\ACL\\Models\\User', NULL, 0, 1, 0, '2023-01-07 20:27:30', '2023-01-15 03:39:53'),
(4, 'Komersial', 0, 'Komersial adalah suatu kegiatan yang dilakukan dengan tujuan untuk mendapatkan keuntungan, umumnya berupa kegiatan yang berhubungan dengan niaga atau perdagangan.', 'published', 1, 'Botble\\ACL\\Models\\User', NULL, 0, 1, 0, '2023-01-07 20:27:30', '2023-01-15 03:40:37');
