INSERT INTO `ec_reviews` (`id`, `customer_id`, `product_id`, `star`, `comment`, `status`, `created_at`, `updated_at`, `images`) VALUES
(1, 1, 30, 2.00, 'The best ecommerce CMS! Excellent coding! best support service! Thank you so much..... I really like your hard work.', 'published', '2023-01-07 20:27:29', '2023-01-07 20:27:29', '[\"products\\/29.jpg\",\"products\\/41.jpg\"]'),
(2, 10, 16, 3.00, 'As a developer I reviewed this script. This is really awesome ecommerce script. I have convinced when I noticed that it\'s built on fully WordPress concept.', 'published', '2023-01-07 20:27:29', '2023-01-07 20:27:29', '[\"products\\/22.jpg\",\"products\\/49.jpg\",\"products\\/61.jpg\"]'),
(3, 5, 58, 5.00, 'The code is good, in general, if you like it, can you give it 5 stars?', 'published', '2023-01-07 20:27:29', '2023-01-07 20:27:29', '[\"products\\/3.jpg\",\"products\\/38.jpg\"]'),
(4, 5, 57, 5.00, 'I Love this Script. I also found how to add other fees. Now I just wait the BIG update for the Marketplace with the Bulk Import. Just do not forget to make it to be Multi-language for us the Botble Fans.', 'published', '2023-01-07 20:27:29', '2023-01-07 20:27:29', '[\"products\\/22.jpg\",\"products\\/42.jpg\"]'),
(5, 3, 35, 4.00, 'Great E-commerce system. And much more : Wonderful Customer Support.', 'published', '2023-01-07 20:27:29', '2023-01-07 20:27:29', '[\"products\\/23.jpg\",\"products\\/46.jpg\",\"products\\/53.jpg\"]'),
(6, 5, 57, 4.00, 'Perfect +++++++++ i love it really also i get to fast ticket answers... Thanks Lot BOTBLE Teams', 'published', '2023-01-07 20:27:29', '2023-01-07 20:27:29', '[\"products\\/1.jpg\",\"products\\/48.jpg\",\"products\\/61.jpg\"]'),
(7, 2, 23, 5.00, 'Second or third time that I buy a Botble product, happy with the products and support. You guys do a good job :)', 'published', '2023-01-07 20:27:29', '2023-01-07 20:27:29', '[\"products\\/27.jpg\",\"products\\/59.jpg\"]'),
(8, 8, 39, 5.00, 'Clean & perfect source code', 'published', '2023-01-07 20:27:29', '2023-01-07 20:27:29', '[\"products\\/25.jpg\",\"products\\/59.jpg\"]'),
(9, 9, 4, 1.00, 'The best store template! Excellent coding! Very good support! Thank you so much for all the help, I really appreciated.', 'published', '2023-01-07 20:27:29', '2023-01-07 20:27:29', '[\"products\\/23.jpg\",\"products\\/39.jpg\",\"products\\/53.jpg\"]'),
